/**
 * Create a new FilterClause
 * @param filter A Filter object containing a BitSet
 * @param occur A parameter implementation indicating SHOULD, MUST or MUST NOT
 */

public FilterClause(Filter filter, Occur occur) {
	this.occur = occur;
	this.filter = filter;
}

